actions.script:
$scope.ACTIONS.GAME.PAUSE();
	$scope.ACTIONS.ANIMATION.PLAY_UP($scope.ACTIONS.NPC.GET("Oka"),"b_admiracion",function(){
		$scope.ACTIONS.NPC.LOOK($scope.ACTIONS.NPC.GET("Oka"),$scope.ACTIONS.PLAYER.GET());
		$scope.ACTIONS.MESSAGE.STATIC("Oka",["Que bueno que llegaste $amigo!","Por favor acércate para contarte de todo este problema grave que nos está envolviendo"],function(){
		$scope.ACTIONS.PROGRESS.SET(1);
		$scope.ACTIONS.GAME.RESUME();
	});
	});

$scope.ACTIONS.MESSAGE.STATIC("Oka",[

"Los Pokemones  se encuentran en el sótano, hay 3 opciones por cada caja con un total de 24 opciones, elige bien!",
"Vamos a evitar que esa magia llegue a las demás 17 naciones que están fuera de peligro ahora mismo."

],function(){  });

var textos = [
"Hola de nuevo $amigo, lamento informarte que la magia ha llegado a otras 5 naciones, se nos ha salido de las manos.",
"Necesitamos que nos ayude a erradicar la magia cuanto antes.",
"Al parecer los líderes de cada nación este efecto le ha tocado de manera especial y los ha cambiado.",
"Han puesto sus ciudades bajo leyes más estrictas y eliminando cualquier rastro de paz",
"Si puedes vencerlos podrás hacerlo volver en sí, puedes dirigirte a donde tu prefieras",
"Puedes consultar el mapa que está en tu menú a la izquierda, podrás ver que nos queda cerca la ruta 1, 8, 9 y 10",
"Espero que tengas buen viaje."
];

$scope.ACTIONS.MESSAGE.STATIC("Oka",textos,function(){

    if($scope.ACTIONS.PROGRESS.GETNATURAL("creenlito")){
      $scope.ACTIONS.MESSAGE.STATIC("Oka__",["Espero que a la siguiente ciudad donde vayas no seas tan crédulo, :)"],function(){
      });
    }
	$scope.ACTIONS.PROGRESS.SET('charladeviaje'); 

});

$scope.ACTIONS.MESSAGE.STATIC("Oka",["Muy bien que hayas elegido tu Pokemon!, Notepa, yo y todos en este pueblo confiamos en ti $amigo","Recuerda siempre tomar las ayudas de cada nuevo amigo y terminar con Lito!","El no es digno de ese puesto como líder de gimnasio y mucho menos después de las fechorías mágicas que ha ejecutado."],function(){

$scope.ACTIONS.PROGRESS.SET("segundavista");
  $scope.ACTIONS.PLAYER.CLEARASSAULT();

});

